      SELECT + + 58 - 91 AS col0 FROM tab1 (FORMAT parquet) WHERE NOT + ( - col0 ) * col1 + col0 + + 75 IS NULL;
  - name: tab1

outputs:
  - name: q12966.out
    data: |
      -33
      -33
      -33
